    "rainwater-basin-wetland-management-district-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Rainwater
    Basin Wetland Management District outlines accomplishments during the 1989 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    research and investigations. Refuge administration is outlined; information about
    personnel, youth programs, funding, and safety is given. Habitat management is also
    covered; subjects include wetlands, forests, croplands, grasslands, grazing, haying,
    fire management, pest control, and water rights. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, and disease control. The
    public uses of the Refuge described in this report include interpretive programs,
    hunting, wildlife observation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, major maintenance,
    equipment replacement, and computer systems. Cooperative programs and items of interest
    are provided at the end. Refuge brochures, articles, and field guides are attached.",nt"license_title":
